import React from "react";
import { Link } from "react-router-dom";
import "./header.css";

function Header({ cartitems }) {
  return (
    <>
      <header className="header">
        <div>
          <h1>
            <Link>Shoping CArt</Link>
          </h1>
        </div>
        <div>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
          </ul>
          <ul>
            <li>
              <Link to="/cart">Cart</Link>
            </li>
          </ul>
          <ul>
            <li>
              Shoping Item
              {cartitems.map((item, id) => {
                return (
                  <>
                    <p key={id}>
                      {item.name}
                      {item.quantity}
                    </p>
                  </>
                );
              })}
            </li>
          </ul>
        </div>
      </header>
    </>
  );
}

export default Header;
